import React, { useState } from 'react'

function Contact() {
    const [val, setVal]=useState({
        name:"",
        query:""
    });
    const [data,setData]=useState();
    const Change=(event)=>{
        const value = event.target.value;
        console.log(value);
       setVal(value);
     
    }
    const Click=()=>{
        setData(val);
        alert(data.name)
    }
  return (
   <>
    <div className='container'>
    <div className='p-4'></div>
        <div className='row  border border-dark rounded p-3'>
            <div className='col '>
                <h1>Contact</h1>
                <p>This is Contact Page</p>
                <br/>
                <form className='form'>
                    <label>Your Name</label>
                    <input type="text" onChange={Change} name="name" className='form-control'/><br/>
                    <label>Your Query</label><br/>
                   <textarea  onChange={Change}  name="query" className='form-control' rows="3" columns=""></textarea> <br/>
                    <button  onClick={Click} className='btn btn-primary'>Submit</button>
                </form>
            </div>
            <div className='col card'>
                <img src="img/a7.jpg"/>
            </div>
        </div>
    </div>
   </>
  )
}

export default Contact;
